let regChart;
const regionDistributionChart = function(data){
    data.sort(num_cases_sorter).reverse()
    // Dataset
    var dataset = [];
    var labels = [];
    data.forEach(function(element){
        dataset.push(element.properties.numero_casi);
        labels.push(element.properties.regione);
    })
    // Grafico
	var ctx = document.getElementById('region-distribution-chart').getContext('2d');
    if (regChart) {regChart.destroy(); }
    
    regChart = new Chart(ctx, {
		type: 'bar',
		data: {
			labels: labels,
			datasets:[{
				label: 'Casi accertati',
				backgroundColor: '#b71c1c',
				borderColor: '#CC0000',
				data: dataset,
				fill: false
			}]
		},
		options: {
            responsive:true,
            title: {
                display: true,
                text: 'Contagi per regione',
                fontColor:'#FFF',
                fontStyle: 'bold',
                fontSizs: 18
            },
            legend:{
                display:false
            },
            scales: {
                yAxes:[{
                    ticks:{
                        fontColor:'#FFF'
                    }
                }],
                xAxes:[{
                    ticks:{
                        fontColor:'#FFF',
                        callback: function(value, index, values) {
                            if (value == ' Provincia autonoma di Trento'){
                                return 'P.A. Trento';
                            } else if (value == ' Provincia autonoma di Bolzano') {
                                return 'P.A. Bolzano';
                            } else if (value == ' Friuli Venezia Giulia') {
                                return 'Friuli';
                            } else {
                                return value;
                            }
                        }
                    }
                }]
            }
		}
	});
}

let totChart;
const casesDiffusionChart = function(data){
    data.reverse()
    // Dataset
    var total_cases = []
    var positive = []
    var dead = []
    var recovered = []
    var bullettin_dates = []
    data.forEach(d =>{
        total_cases.push(d.totale) 
        positive.push(d.positivi)
        dead.push(d.deceduti)
        recovered.push(d.guariti)
        bullettin_dates.push(moment(d.aggiornamento).format('DD MMM, HH:mm'))
    });
    // Grafico
	var ctx = document.getElementById('total-cases-chart').getContext('2d');
    if (totChart) {totChart.destroy(); }
    
    totChart = new Chart(ctx, {
		type: 'line',
		data: {
			labels: bullettin_dates,
			datasets:[{
				label: 'Contagiati',
				backgroundColor: '#b71c1c',
				borderColor: '#CC0000',
				data: total_cases,
				fill: false
			},{
				label: 'Positivi',
				backgroundColor: '#FF8800',
				borderColor: '#e65100',
				data: positive,
				fill: false
			},{
				label: 'Guariti',
				backgroundColor: '#00C851',
				borderColor: '#007E33',
				data: recovered,
				fill: false
			},{
				label: 'Morti',
				backgroundColor: '#aa66cc',
				borderColor: '#9933CC',
				data: dead,
				fill: false
			}]
		},
		options: {
            responsive:true,
            title: {
                display: true,
                text: 'Andamento giorno per giorno',
                fontColor:'#FFF',
                fontStyle: 'bold',
                fontSizs: 18
            },
            legend:{
                display:true,
                position: 'left',
                labels:{
                    fontColor:'#bdbdbd'
                }
            },
            scales: {
                yAxes:[{
                    ticks:{
                        fontColor:'#FFF'
                    }
                }],
                xAxes:[{
                    ticks:{
                        fontColor:'#FFF'
                    }
                }]
            }
		}
	});
}

